import React, { useContext } from 'react';

const Home = () => {
    const { logout } = useContext()

    function handleLogout() {
        logout()
    }

    return (
        <div className="container">
            HOME
            <button onClick={handleLogout}>logout</button>
        </div>
    );
};

export default Home;
